commonfields:
  id: PhishingIncident
  version: -1
name: PhishingIncident
script: |-
  import base64

  MALICIOUS_TEXT = '2d8bb37078ff9efd02d9361975c9e625ae56bd8a8a65d50fc568341bc88392ae'

  args = demisto.args()

  incidents = {
      'name' : args['malicious_location'],
      'labels' : [
          {'Email/from': 'test@demistodev.com'},
          {'Email/to' : 'admin@demistodev.com'},
      ],
      'rawJSON' : json.dumps({
          'Type' : 'Phish',
          'Subject' : 'Phishing test playbook',
          'To' : 'admin@demistodev.com',
          'From' : 'test@demistodev.com',
      })
  }

  demisto.executeCommand("setIncident", incidents)

  if args['malicious_location'] == "attachment":
      eml_file = ""
  else:
      eml_file = ""

  file_name = "{0}.eml".format(args['malicious_location'])
  data = base64.b64decode(eml_file).decode('utf-8')
  demisto.results(fileResult(file_name, data))
type: python
tags: []
enabled: true
args:
- name: malicious_location
  required: true
  auto: PREDEFINED
  predefined:
  - attachment
  - inline
scripttarget: 0
runonce: false
